import React from 'react';
import './Styles/Header.css';

const Header = () => {
    return (
        <>
        <nav className="header"> 
        <h1>Fonzo's Vet Services</h1>
            <ul className="header-links">
                <li className="header-item">first liink</li>
                <li className="header-item">two</li>
                <li className="header-item">three</li>
            </ul>
        </nav>
        </>
    );
};

export default Header;
